import React, { Component } from 'react'

export default class YoutubeVideo extends Component {

    constructor() {
        super();
        this.state = {
            allDetails: {},
            videoURL: "",
            videoID: "fuck"
        }
    }

    componentWillMount() {
        this.state.allDetails = this.props.videoDetails;
        this.state.videoID = "#" + this.state.allDetails['resourcsId']['videoId'];
        console.log(this.state.videoID);
    }


    render() {
        return (
            <div>
                <button type="button" className="btn btn-danger" data-toggle="modal" data-target="#beatrizVideo">
                    {this.state.videoID}
                </button>
            </div>
        )
    }
}
